import React from 'react';

import Nav from './template/Nav'
import Header from './template/Carousel'
import Footer from './template/Footer'
import {BrowserRouter} from 'react-router-dom'
import Routes from './Routes'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Nav />
      <Header />
        <Routes />
      <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
